import React from 'react'
import './header.css'
import { Link } from "react-router-dom";
import camera from "./photo/camera.png"

const Header = () => {
  return (
    <header>
        <ul>
            <li><Link to="/">home</Link></li>
            <li><Link to="/photo_library"><img src="camera" alt="" />photo</Link></li>
            <li><Link to="/calculate">programming</Link></li>
        </ul>
    </header>
  )
}

export default Header
